/**
 * Sample React Native App
 * https://github.com/facebook/react-native
 *
 * @format
 * @flow strict-local
 */

import React from 'react';
import {
  SafeAreaView,
  StyleSheet,
  StatusBar,
} from 'react-native';
import { createStore } from 'redux'
import { Provider } from 'react-redux'
import reducer from '../reducers'

import { enableScreens } from "react-native-screens";
enableScreens();
import PrimaryNavigation from '../navigators/PrimaryNavigation';
import Authentication from '../navigators/Authentaction';

declare const global: {HermesInternal: null | {}};

const App = () => {
  return (
    <Provider store={createStore(reducer)}>
      <StatusBar barStyle="dark-content" />
      <SafeAreaView>
        <PrimaryNavigation />
        <Authentication />
      </SafeAreaView>
    </Provider>
  );
};

const styles = StyleSheet.create({
  scrollView: {
    backgroundColor: 'gray',
  },
  engine: {
    position: 'absolute',
    right: 0,
  },
  body: {
    backgroundColor: 'white',
  },
  sectionContainer: {
    marginTop: 32,
    paddingHorizontal: 24,
  },
  sectionTitle: {
    fontSize: 24,
    fontWeight: '600',
    color: 'black',
  },
  sectionDescription: {
    marginTop: 8,
    fontSize: 18,
    fontWeight: '400',
    color: '#666',
  },
  highlight: {
    fontWeight: '700',
  },
  footer: {
    color: '#666',
    fontSize: 12,
    fontWeight: '600',
    padding: 4,
    paddingRight: 12,
    textAlign: 'right',
  },
});

export default App;
